import React from "react";
import "./Home.css";
import "bootstrap/dist/css/bootstrap.min.css";

function Home() {
  return (
    <div className="flex">
      <div className="flex">
        <h2>Welcome to your Rockect Elevators Portail</h2>
        <h4>Your interventions</h4>
      </div>
      <div className="InterventionCard"></div>
    </div>
  );
}

export default Home;
